export default function Contact() {
    return (
        <div id="mySidenav" class="sidenav">
            <a
                href="#"
                id="about"
                style={{
                    position: absolute,
                    left: '-80px',
                    transition: '0.3s',
                }}
            >
                About
            </a>
            <a href="#" id="blog">
                Blog
            </a>
            <a href="#" id="projects">
                Projects
            </a>
            <a href="#" id="contact">
                Contact
            </a>
        </div>
    );
}
